import React, { Component } from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faUserCircle, faLock } from '@fortawesome/free-solid-svg-icons'
import './User.css'

export default class User extends Component {
    render() {
        const center ={
            textAlign: "center"
        }
        const pos= {
            position: "relative"
        }
        return (
            <div className="mainBg">
                <div className="formContainer">
                    <form>
                        <h3 style={center}>Sign In</h3>
                        {/* <label className="formLabel">User Id</label><br></br> */}
                        <div style={pos}>
                        <FontAwesomeIcon icon={faUserCircle} size="3x" className="icon" color="white"/>
                        <input className="inputField" type="text" placeholder="Username" autoComplete="off"></input>
                        </div>
                        <br />
                        {/* <label className="formLabel">Password</label><br></br> */}
                        <FontAwesomeIcon icon={faLock} size="3x" className="icon" color="white"/>
                        <input className="inputField" type="password" placeholder="Password"></input>
                        <br/>
                        <input className="btn" type="submit" value="Login"></input>
                    </form>
                </div>
            </div>
        )
    }
}
